import { Hello } from "./example/hello";

export function Exam1() {
  // canvas 크기 지정
  const canvas = document.querySelector("canvas");
  canvas.width = window.innerWidth;
  canvas.height = window.innerHeight;

  const ctx = canvas.getContext("2d");

  Hello(ctx);
}
